import * as React from 'react';
import { Button } from 'react-native-web';
import {Container,Container2,Container3} from './styles';
import { View,ImageBackground} from 'react-native';

function Tela6Screen({navigation,route}) {
    const item = route.params;
    return(
        <Container>
            <ImageBackground source={require ('../Tela6/Frame.png')} 
                style={{height: 488.72,
                    width: 167.19,
                    left: 3.7,
                    top: 61.18,
                    borderRadius: 0,
                    left: 105.7,
                    right: 102.12,
                    bottom: 0.02,
                    position: 'absolute'
                }}
            />
            <Container2></Container2>
            <Container3></Container3>
            <Image source={require('../Tela6/Camera.png')}
                style={{position: 'absolute',
                width: 18.5,
                height: 16.32,
                left:273.75,
                top: 614.75
                }}
            />
            <Image source={require('../Tela6/Camera1.png')}
                style={{position: 'absolute',
                width: 18.5,
                height: 16.32,
                left:178.75,
                top: 614.75
                }}
            />
        </Container>
        
    );
}
export default Tela6Screen;
